import React from 'react'
import Grid from "@material-ui/core/Grid";
import CompositionCard from "./CompositionCard";
import styled from 'styled-components'


const CompositionListWrapper = styled(Grid)`
    flex-grow: 1;
`

function CompositionList({compositions = '', ...props}) {
    const compositionNodes = compositions ?
        compositions.map(compInfo => <CompositionCard key={compInfo.id} info={compInfo}/>) :
        <div>Не найдено ни одной композиции...</div>

    return (
        <CompositionListWrapper container>
            <Grid item xs={12}>
                <Grid container justify="center">
                    {compositionNodes}
                </Grid>
            </Grid>
        </CompositionListWrapper>
        // <Box
        //     display="flex"
        //     alignContent="flex-start"
        //     justifyContent="flex-start"
        //     flexWrap="wrap"
        //     p={1}
        //     m={1}
        // >
        //     {compositionNodes}
        // </Box>
    );
}

export default CompositionList
